import React from 'react';

const Menu = ({ items }) => {

  const menuItems = items.map(item => {
    const { id, title, category, price, img, desc } = item;
    return (
      <article key={id}>
        <img src={img} alt={title} />
      </article>
    );
  });

  return (
    <div className='section-center'>
      {menuItems}
    </div>
  );
};

export default Menu;
